import Navbar from './Components/Navbar'
import Description from './Components/Description'
import Game from './Components/Game'
import Footer from './Components/Footer';
import './App.css';
import React from 'react'

function App() {
  return (
    <div className='body'>
      <Navbar/>
      <br></br>
      <Description/>
      <br></br>
      <Game/>
      <Footer/>
    </div>
  )
}

export default App
